import React,{Component} from 'react';
import './Order.css'
import dayjs from "dayjs"
class Orders extends Component{
    constructor(props) {
        super(props);
        this.state = {
            date:dayjs()
        };
      }
    //   const today=dayjs();
      render(){
       console.log(this.state.date) 
       
      return(
        <div  className="navright">
            <h1> Đơn Hàng</h1>
            <div className="order">
                <input type="date" value={this.state.date.date}></input>
            </div>
        </div>
      )
    }
}
export default Orders;
